using System;

namespace BlackjackSimulation
{
    class B10MoveStrategy : IPlayerMoveStrategy
    {

        private int[] cardAmounts;
        private double[] cardAmountsDouble;
        private double allCards, aces, twos, threes, fours, fives, sixes, sevens, eights, nines, tens;
        private double _dealerUpCard, _playerSum;
        

        public B10MoveStrategy(int[] cardAmounts)
        {
            this.cardAmounts = cardAmounts;
        }

        public void SetCardAmounts()
        {
            allCards = cardAmounts[0];
            aces = cardAmounts[1];
            twos = cardAmounts[2];
            threes = cardAmounts[3];
            fours = cardAmounts[4];
            fives = cardAmounts[5];
            sixes = cardAmounts[6];
            sevens = cardAmounts[7];
            eights = cardAmounts[8];
            nines = cardAmounts[9];
            tens = cardAmounts[10] + cardAmounts[11] + cardAmounts[12] + cardAmounts[13];

            cardAmountsDouble = new double[11]{allCards,aces,twos,threes,fours,fives,sixes,sevens,eights,nines,tens};
                       
        }

        public MoveAction Response(Hand hand, Card dealerUpCard, bool hasSplittedHand)
        {
            SetCardAmounts();
            _playerSum = hand.GetValues()[0];
            _dealerUpCard = dealerUpCard.GetCardValue();
            return MoveComparator(_playerSum, _dealerUpCard, false);
        }


        public MoveAction MoveComparator(double playerSum, double dealerUpCard, bool isSoft)
        {
            MoveAction response = MoveAction.Stand;

            //TODO Soft hand comparations..
            if (isSoft)
            {

            }

            else
            {
                if (WinChanceWhenStand(playerSum, dealerUpCard) > WinChanceWhenHit(playerSum, dealerUpCard, false))
                {
                    response = MoveAction.Stand; // stand
                }
                else
                {
                    if (WinChanceWhenDoubleDown(playerSum, dealerUpCard) > 0.505)
                    {
                        response = MoveAction.Double; // double
                    }
                    else
                    {
                        response = MoveAction.Hit; // hit
                    }
                }
            }
            return response;
        }

        public double ProbOf(int card)
        {
            return cardAmountsDouble[card] / allCards;
        }

        public double WinChanceWhenHit(double playerTotal, double dealerUpcard, bool AddStandChance)
        {
            double probability = 0d;
            for (double i = 1d; i < 11d; i++)
                if (playerTotal + i < 22d)
                    probability += ProbOf((int)i) * WinChanceWhenHit(playerTotal + i, dealerUpcard, true);

            if (AddStandChance == true) 
                probability += WinChanceWhenStand(playerTotal, dealerUpcard); 

            return probability;
        }
        
        public double WinChanceWhenStand(double playerTotal, double dealerUpcard)
        {
            if (playerTotal < 18d)
                return 1d - (DealerProbOfGoal(dealerUpcard, 17d) + DealerProbOfGoal(dealerUpcard, 18d) + DealerProbOfGoal(dealerUpcard, 19d) + DealerProbOfGoal(dealerUpcard, 20d) + DealerProbOfGoal(dealerUpcard, 21d));
            else if (playerTotal == 18d)
                return 1d - (DealerProbOfGoal(dealerUpcard, 18d) + DealerProbOfGoal(dealerUpcard, 19d) + DealerProbOfGoal(dealerUpcard, 20d) + DealerProbOfGoal(dealerUpcard, 21d));
            else if (playerTotal == 19d)
                return 1d - (DealerProbOfGoal(dealerUpcard, 19d) + DealerProbOfGoal(dealerUpcard, 20d) + DealerProbOfGoal(dealerUpcard, 21d));
            else if (playerTotal == 20d)
                return 1d - (DealerProbOfGoal(dealerUpcard, 20d) + DealerProbOfGoal(dealerUpcard, 21d));
            else if (playerTotal == 21d)
                return 1d - DealerProbOfGoal(dealerUpcard, 21d);
            else
                throw new ArgumentException("Player total > 21 !");
        }

        public double WinChanceWhenDoubleDown(double playerTotal, double dealerUpcard)
        {
            double probability = 0d;

            for (double i = 1d; i < 11d; i++)
                if (playerTotal + i < 22d)
                    probability += ProbOf((int)i) * WinChanceWhenStand(playerTotal + i, dealerUpcard);

            return probability;
        }

